module.exports = {
    root: true,
    env: {
        node: true,
    },
    extends: ["plugin:vue/essential", "eslint:recommended", "@vue/prettier"],
    parserOptions: {
        parser: "babel-eslint",
    },
    rules: {
        "no-console": process.env.NODE_ENV === "production" ? "warn" : "off",
        "no-debugger": process.env.NODE_ENV === "production" ? "warn" : "off",
    },
    overrides: [
        {
            files: [
                "**/__tests__/*.{j,t}s?(x)",
                "**/tests/unit/**/*.spec.{j,t}s?(x)",
            ],
            env: {
                jest: true,
            },
        },
    ],
};

module.exports = {
    presets: ["@vue/cli-plugin-babel/preset"],
    plugins: [
        [
            "import",
            {
                libraryName: "ant-design-vue",
                libraryDirectory: "es",
                style: true,
            },
        ],
    ],
};

const path = require("path");
const isProd = process.env.NODE_ENV === "production";

function resolve(dir) {
    return path.join(__dirname, dir);
}

module.exports = {
    lintOnSave: false,
    runtimeCompiler: true,
    assetsDir: "public",
    publicPath: isProd ? "./" : "/",
    productionSourceMap: true,
    // webpackÁöÑÁõ∏ÂÖ≥ÈÖçÁΩÆ
    configureWebpack: {
        entry: "./src/renderer/main.js",
        resolve: {
            extensions: [".js", ".vue", ".json", ".ts", ".less"],
            alias: {
                "@": resolve("src/renderer"),
            },
        },
        // ÂÖ¨ÂÖ±ËµÑÊ∫êÂêàÂπ∂
        optimization: {
            splitChunks: {
                cacheGroups: {
                    vendor: {
                        chunks: "all",
                        test: /node_modules/,
                        name: "vendor",
                        minChunks: 1,
                        maxInitialRequests: 5,
                        minSize: 0,
                        priority: 100,
                    },
                    common: {
                        chunks: "all",
                        test: /[\\/]src[\\/]js[\\/]/,
                        name: "common",
                        minChunks: 2,
                        maxInitialRequests: 5,
                        minSize: 0,
                        priority: 60,
                    },
                    styles: {
                        name: "styles",
                        test: /\.(sa|sc|le|c)ss$/,
                        chunks: "all",
                        enforce: true,
                    },
                    runtimeChunk: {
                        name: "manifest",
                    },
                },
            },
        },
        // ÊÄßËÉΩË≠¶Âëä‰øÆÊîπ
        performance: {
            hints: "warning",
            // ÂÖ•Âè£Ëµ∑ÁÇπÁöÑÊúÄÂ§ß‰ΩìÁßØ Êï¥Êï∞Á±ªÂûãÔºà‰ª•Â≠óËäÇ‰∏∫Âçï‰ΩçÔºâ
            maxEntrypointSize: 50000000,
            // ÁîüÊàêÊñá‰ª∂ÁöÑÊúÄÂ§ß‰ΩìÁßØ Êï¥Êï∞Á±ªÂûãÔºà‰ª•Â≠óËäÇ‰∏∫Âçï‰Ωç 300kÔºâ
            maxAssetSize: 30000000,
            // Âè™ÁªôÂá∫ js Êñá‰ª∂ÁöÑÊÄßËÉΩÊèêÁ§∫
            assetFilter: function (assetFilename) {
                return assetFilename.endsWith(".js");
            },
        },
    },
    chainWebpack: (config) => {
        // ÂàÜÊûêÊèí‰ª∂
        // config
        //   .plugin("webpack-bundle-analyzer")
        //   .use(require("webpack-bundle-analyzer").BundleAnalyzerPlugin)
        //   .end();
    },
    // ÊâìÂåÖËæìÂá∫Ë∑ØÂæÑ
    outputDir: "dist/web",
    productionSourceMap: false,
    // ÊûÑÂª∫Êó∂ÂºÄÂêØÂ§öËøõÁ®ãÂ§ÑÁêÜ babel ÁºñËØë
    //   parallel: require('os').cpus().length > 1,
    css: {
        // ÊòØÂê¶‰ΩøÁî®cssÂàÜÁ¶ªÊèí‰ª∂ ExtractTextPlugin
        extract: isProd,
        // ÂºÄÂêØ CSS source maps?
        sourceMap: !isProd,
        // cssÈ¢ÑËÆæÂô®ÈÖçÁΩÆÈ°π
        loaderOptions: {
            less: {
                modifyVars: {
                    "primary-color": "#c62f2f",
                    "link-color": "#c62f2f",
                    "border-radius-base": "4px",
                },
                javascriptEnabled: true,
            },
        },
        // ÂêØÁî® CSS modules for all css / pre-processor files.
        requireModuleExtension: true,
    },
    // ÂºÄÂèëÊúçÂä°Âô®http‰ª£ÁêÜ
    devServer: {
        open: !process.argv.includes("electron:serve"),
        host: "localhost",
        port: 9080,
        https: false,
        hotOnly: false,
    },
    // Á¨¨‰∏âÊñπÊèí‰ª∂ÈÖçÁΩÆ
    pluginOptions: {
        // vue-cli-plugin-electron-builderÈÖçÁΩÆ
        electronBuilder: {
            nodeIntegration: true,
            builderOptions: {
                win: {
                    icon: "build/electron-icon/icon.ico",
                    // ÂõæÊ†áË∑ØÂæÑ windowsÁ≥ªÁªü‰∏≠iconÈúÄË¶Å256*256ÁöÑicoÊ†ºÂºèÂõæÁâáÔºåÊõ¥Êç¢Â∫îÁî®ÂõæÊ†á‰∫¶Âú®Ê≠§Â§Ñ
                    target: [
                        {
                            // ÊâìÂåÖÊàê‰∏Ä‰∏™Áã¨Á´ãÁöÑ exe ÂÆâË£ÖÁ®ãÂ∫è
                            target: "nsis",
                            // Ëøô‰∏™ÊÑèÊÄùÊòØÊâìÂá∫Êù•32 bit + 64 bitÁöÑÂåÖÔºå‰ΩÜÊòØË¶ÅÊ≥®ÊÑèÔºöËøôÊ†∑ÊâìÂåÖÂá∫Êù•ÁöÑÂÆâË£ÖÂåÖ‰ΩìÁßØÊØîËæÉÂ§ßÔºåÊâÄ‰ª•Âª∫ËÆÆÁõ¥Êé•Êâì32ÁöÑÂÆâË£ÖÂåÖ„ÄÇ
                            arch: [
                                "x64",
                                // 'ia32'
                            ],
                        },
                    ],
                },
                dmg: {
                    contents: [
                        {
                            x: 410,
                            y: 150,
                            type: "link",
                            path: "/Applications",
                        },
                        {
                            x: 130,
                            y: 150,
                            type: "file",
                        },
                    ],
                },
                linux: {
                    icon: "build/electron-icon/icon.png",
                    target: "AppImage",
                },
                mac: {
                    icon: "build/electron-icon/icon.icns",
                },
                files: ["**/*"],
                asar: true,
                nsis: {
                    // ÊòØÂê¶‰∏ÄÈîÆÂÆâË£ÖÔºåÂª∫ËÆÆ‰∏∫ falseÔºåÂèØ‰ª•ËÆ©Áî®Êà∑ÁÇπÂáª‰∏ã‰∏ÄÊ≠•„ÄÅ‰∏ã‰∏ÄÊ≠•„ÄÅ‰∏ã‰∏ÄÊ≠•ÁöÑÂΩ¢ÂºèÂÆâË£ÖÁ®ãÂ∫èÔºåÂ¶ÇÊûú‰∏∫trueÔºåÂΩìÁî®Êà∑ÂèåÂáªÊûÑÂª∫Â•ΩÁöÑÁ®ãÂ∫èÔºåËá™Âä®ÂÆâË£ÖÁ®ãÂ∫èÂπ∂ÊâìÂºÄÔºåÂç≥Ôºö‰∏ÄÈîÆÂÆâË£ÖÔºàone-click installerÔºâ
                    oneClick: false,
                    // ÂÖÅËÆ∏ËØ∑Ê±ÇÊèêÂçá„ÄÇ Â¶ÇÊûú‰∏∫falseÔºåÂàôÁî®Êà∑ÂøÖÈ°ª‰ΩøÁî®ÊèêÂçáÁöÑÊùÉÈôêÈáçÊñ∞ÂêØÂä®ÂÆâË£ÖÁ®ãÂ∫è„ÄÇ
                    allowElevation: true,
                    // ÂÖÅËÆ∏‰øÆÊîπÂÆâË£ÖÁõÆÂΩïÔºåÂª∫ËÆÆ‰∏∫ trueÔºåÊòØÂê¶ÂÖÅËÆ∏Áî®Êà∑ÊîπÂèòÂÆâË£ÖÁõÆÂΩïÔºåÈªòËÆ§ÊòØ‰∏çÂÖÅËÆ∏
                    allowToChangeInstallationDirectory: true,
                    // ÂÆâË£ÖÂõæÊ†á
                    installerIcon: "build/electron-icon/icon.ico",
                    // Âç∏ËΩΩÂõæÊ†á
                    uninstallerIcon: "build/electron-icon/icon.ico",
                    // ÂÆâË£ÖÊó∂Â§¥ÈÉ®ÂõæÊ†á
                    installerHeaderIcon: "build/electron-icon/icon.ico",
                    // ÂàõÂª∫Ê°åÈù¢ÂõæÊ†á
                    createDesktopShortcut: true,
                    // ÂàõÂª∫ÂºÄÂßãËèúÂçïÂõæÊ†á
                    createStartMenuShortcut: true,
                },
            },
            chainWebpackMainProcess: (config) => {
                config.plugin("define").tap((args) => {
                    args[0]["IS_ELECTRON"] = true;
                    return args;
                });
            },
            chainWebpackRendererProcess: (config) => {
                config.plugin("define").tap((args) => {
                    args[0]["IS_ELECTRON"] = true;
                    return args;
                });
            },
            outputDir: "dist/electron",
            mainProcessFile: "src/main/main.js",
            mainProcessWatch: ["src/main"],
        },
    },
};
